import React, {useEffect, useState} from 'react';
import { useLocation } from 'react-router-dom';
//import './style.css';


export default function RoomPage() {
    const [username, setUsername] = useState([]);
    const [password, setPassword] = useState([]);
    const [loginType, setLoginType] = useState([]);
    const [name, setName] = useState([]);
    const [modules, setModules] = useState([]);

    useEffect(() => {
        setUsername(sessionStorage.getItem("Username"));
        setPassword(sessionStorage.getItem("Password"));
        setLoginType(sessionStorage.getItem("LoginType"));

        fetch("/api/get-name", {
            method: 'POST',
            body: JSON.stringify({data: [sessionStorage.getItem("Username"), sessionStorage.getItem("Password"), sessionStorage.getItem("LoginType")]}),
            headers: {
                'Content-Type': 'application/json'
            }
        })
        .then(response => response.json())
        .then(data => {
            if (data === "INVALID") {
                alert("Access Denied.");
            }
            else {
                setName(data);
            }
        })
        .catch(error => console.error(error))

        fetch("/api/get-student-modules", {
            method: 'POST',
            body: JSON.stringify({data: [sessionStorage.getItem("Username"), sessionStorage.getItem("Password"), sessionStorage.getItem("LoginType")]}),
            headers: {
                'Content-Type': 'application/json'
            }
        })
        .then(response => response.json())
        .then(data => {
            if (data === "INVALID") {
                alert("Access Denied.");
            }
            else {
                setModules(data);
            }
        })
        .catch(error => console.error(error))
    }, []);

    function ModuleOptions() {
        let rows = [];

        for (let module of modules) {
            rows.push(
                <option value={module}>{module}</option>
            );
        }
        return rows;
    }
    return <div className="student-home-page">
        <div>
            <h1>You are signed in as {name}</h1>
            <p>Make a new request:</p>
            <select id="loginTypeSelect">
                <ModuleOptions/>
            </select>
            <button type="button" id="button" >Start</button>
            <p></p>
        </div>

    </div>
}
